import "./ExpensesFilter.css";

const ExpenseFilter = () => {
  return (
    <div className="expense-filter">
      <label>choose year</label>
      <select>
        <option>2020</option>
        <option>2021</option>
        <option>2022</option>
      </select>
    </div>
  );
};

export default ExpenseFilter;
